import Typical from 'react-typical';

import Header from './Header';

import './style.css';

const About = () => {
    return (
        <div>
            <Header />
            <div className="app">
                <div className="ui card">
                    <div className="image">
                        <img src="headShot.jpg" alt='author' />
                    </div>
                    <div className="content">
                        <div className="header">
                            Hi, I'm Johnny</div>
                        <div className="description">
                            Hi
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default About;
